import React from 'react';
//import NavigationBar from './NavigationBar.css'

class NavigationBar extends React.Component {
   constructor() {
     super()
     this.state = {}
   }

   render() {
     return (
       <nav className={NavigationBar}>
         <h2>See Or Skip?</h2>
         <ul>
           <li>Home</li>
           <li>Find Movie Sentiment</li>
           <li>Compare Page</li>
         </ul>
       </nav>
     )
   }
}

export default NavigationBar;
